import Item from "./Item";
import './Transection.css'

const Transection =(props)=>{
  const {items} = props
    return (
      <ul className = "item-list">
          {items.map((element) => {
            return <Item {...element} />
          })}
      </ul>
    );
  
  } 
  export default Transection;
